function WordByLetter({ word, style }) {
    return (
        <div className="word">
            {console.log(word)}
            {word.split("").map((letter, index) => {
                return (
                    <span key={index} className={style}>
                        {letter}
                    </span>
                );
            })}
        </div>
    );
}

export default WordByLetter;
